import React from "react";
import "./index.css";
import PropTypes from "prop-types"; 

function Menu({button_titles}) {
    return <header className="menu">
            {button_titles.map((title, id) => {
                return <button className={`menu_button_${id}`}>{title}</button>
            })}  
           </header>
}

Menu.propTypes = {
    buttons_title: PropTypes.arrayOf(PropTypes.string).isRequired,
}

export default Menu
